import classes from './styles/main.module.css';

function Main() {
    return (
        <div className={classes.Main}>
            <h1>Olá, eu sou a Cíntia</h1>
            <p>Estudante de ciência da computação, com interesse especial em UI/UX</p>
        </div>
    );
}

export default Main;
